import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider, useAuth } from './contexts/AuthContext';
import Home from './pages/Home';
import AllPropertiesPage from './pages/AllPropertiesPage';
import ChaletDetailPage from './pages/ChaletDetailPage';
import Login from './pages/Login';
import Register from './pages/Register';
import AdminDashboard from './pages/AdminDashboard';
import UserDashboard from './pages/UserDashboard';
import DashboardOverview from './components/DashboardOverview';
import UserManagement from './components/UserManagement';
import PropertyManagement from './components/PropertyManagement';
import ReportsSection from './components/ReportsSection';
import ComingSoon from './pages/ComingSoon';

// Define the protected route components
const ProtectedRoute = ({ children }) => {
  const { isAuthenticated } = useAuth();
  if (!isAuthenticated) return <Navigate to="/login" replace />;
  return children;
};

const AdminRoute = ({ children }) => {
  const { isAuthenticated, isAdmin } = useAuth();
  if (!isAuthenticated) return <Navigate to="/login" replace />;
  if (!isAdmin) return <Navigate to="/user-dashboard" replace />;
  return children;
};

const UserRoute = ({ children }) => {
  const { isAuthenticated, isUser } = useAuth();
  if (!isAuthenticated) return <Navigate to="/login" replace />;
  if (!isUser) return <Navigate to="/admin-dashboard" replace />;
  return children;
};

// Main App component with routes
function AppRoutes() {
  return (
    <Routes>
      {/* Public Routes */}
      <Route path="/" element={<Home scrollTo="hero" />} />
      <Route path="/home" element={<Home scrollTo="hero" />} />
      <Route path="/properties" element={<AllPropertiesPage />} />
      <Route path="/about" element={<Home scrollTo="about" />} />
      <Route path="/contact" element={<Home scrollTo="contact" />} />
      <Route path="/coming-soon" element={<ComingSoon />} />
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />
      <Route path="/ChaletDetailPage" element={<ChaletDetailPage />} />
      <Route path="/chalet/:slug" element={<ChaletDetailPage />} />

      {/* Admin Routes */}
      <Route path="/admin-dashboard" element={
        <AdminRoute>
          <AdminDashboard />
        </AdminRoute>
      } />
      <Route path="/admin-dashboard/overview" element={
        <AdminRoute>
          <DashboardOverview />
        </AdminRoute>
      } />
      <Route path="/admin-dashboard/users" element={
        <AdminRoute>
          <UserManagement />
        </AdminRoute>
      } />
      <Route path="/admin-dashboard/properties" element={
        <AdminRoute>
          <PropertyManagement />
        </AdminRoute>
      } />
      <Route path="/admin-dashboard/reports" element={
        <AdminRoute>
          <ReportsSection />
        </AdminRoute>
      } />

      {/* User Routes */}
      <Route path="/user-dashboard" element={
        <UserRoute>
          <UserDashboard />
        </UserRoute>
      } />

      {/* 404 Route */}
      <Route path="*" element={<Navigate to="/" replace />} />
    </Routes>
  );
}

function App() {
  return (
    <Router>
      <AuthProvider>
        <div className="App">
          <main>
            <AppRoutes />
          </main>
        </div>
      </AuthProvider>
    </Router>
  );
}

export default App;
